9	Cá Basa kho tộ 	Cá Basa Kho Tộ có vị ngọt béo đặc trưng sẽ khiến cho bữa cơm của gia đình bạn thêm hấp dẫn bội phần đấy! Cách kho cá basa đơn giản, thịt cá kho chín bùi béo, ngấm vị đậm đà, cực ngon cơm. Những lúc trời mưa se lạnh lách tách mà có món cá kho này ăn cơm thì còn gì bằng nữa không nào.	Thành phầnKhẩu phần: 2 người\r\nCá ba sa250 Gr\r\nTỏi băm1 Muỗng cà phê\r\nHành tím băm1 Muỗng cà phê\r\nHành lá1 Muỗng canh\r\nMuối1/2 Muỗng cà phê\r\nNước mắm1 Muỗng canh\r\nĐường trắng5 Muỗng canh\r\nDầu ăn1 Muỗng canh\r\nHướng dẫn thực hiện\r\n1.\r\n\r\nRửa sạch các miếng cá basa, để ráo, ướp cá với ½ muỗng cà phê muối khoảng 15 phút. Hành lá cắt nhuyễn.\r\n\r\n2.\r\n\r\nCách kho cá basa: Bắc chảo không dính lên bếp, cho một muỗng dầu ăn và 2 muỗng cà phê đường vào chảo. Đợi cho đến khi đường tan và chuyển màu cánh gián thì cho 1 muỗng tỏi và hành băm nhỏ vào phi thơm, tắt bếp.\r\n\r\n3.\r\n\r\nCách làm cá basa kho tộ: Cho cá vào chảo trên, thêm 1 muỗng nước mắm và 3 muỗng cà phê đường, bật bếp để lửa to cho sôi bùng lên thì giảm xuống ở mức lửa nhỏ nhất, thêm 2 muỗng nước lọc, thả ớt trái vào, đun đến khi nước sệt lại là được.\r\n\r\n4.\r\n\r\nTắt bếp, rải hành lá vào cùng chút tiêu sẽ giúp cá khô tộ thơm ngon hơn nhé.\r\n\r\n5.\r\n\r\nDùng cá basa kho tộ với cơm nóng là nhất luôn. Nước kho cá basa có thể chấm kèm dưa leo và rau sống ăn rất ngon. Cách làm cá basa kho tộ rất đơn giản, thích hợp cho các bạn lần đầu làm món cá kho tại nhà.		f	2022-03-25 06:51:09.508491	1	10
10	Bún chay kiểu Huế	 món ăn sáng được rất nhiều người yêu thích bởi vị ngon tự nhiên, hấp dẫn. Cách nấu bún chay kiểu Huế khá đơn giản với nước dùng ngọt tự nhiên từ rau củ thơm lừng, và đậm đà. Nếu ngày rằm vẫn chưa biết nấu gì, thì triển ngay cách nấu bún chay thơm ngon này nhé. Đảm bảo hương vị của món bún chay này không thua bất mì món mặn nào đâu đấy. 	Thành phầnKhẩu phần: 2 người\r\nBí đỏ500 Gr\r\nCủ cải trắng300 Gr\r\nThơm1/2 Trái\r\nCải thảo250 Gr\r\nCà chua300 Gr\r\nNấm rơm200 Gr\r\nĐậu hũ chiên2 Miếng\r\nSả4 Cây\r\nHành boa rô5 Cây\r\nHạt nêm chay2 Muỗng canh\r\nĐường phèn1 Muỗng canh\r\nDầu điều1/2 Muỗng cà phê\r\nBún tươi500 Gr\r\nHướng dẫn thực hiện\r\n1.\r\n\r\nNguyên liệu nấu bún chay: Rau sống rửa sạch để ráo. Rau củ quả rửa sạch cắt khúc, lá hành boa-rô cắt khúc.\r\n\r\n2.\r\n\r\nCách nấu bún chay: Cho tất cả rau củ quả vào nồi, rồi cho nước, ít muối vào hầm cho ra nước ngọt, hầm đến khi hỗn hợp mềm. Sau đó lược lấy nước dùng, chỉ sử dụng lại củ cải trắng thôi (rau củ quả còn lại dùng vào việc khác).\r\n\r\n3.\r\n\r\nCho nồi nước dùng bún chay đã lược lại lên bếp, củ cải trắng (đã nấu chín), thơm cắt miếng, cọng sả đập dập, ít cọng trắng đầu hành boa rô cắt khúc vào nấu với lửa nhỏ cho thơm mềm. Rồi nêm nếm gia vị: hạt nêm chay, đường phèn, đậu hũ cắt nhỏ vào (khi nào ăn mới cho vào), ít dầu màu điều cho đẹp.\r\n\r\n4.\r\n\r\nSốt nấm ăn kèm bún chay Huế: Cho ít dầu ăn vào chảo, dầu nóng cho đầu hành boa rô băm nhỏ vào phi thơm rồi cho cà chua cắt hạt lựu vào xào, kế đó cho nấm rơm và ít nước vào, gia vị đậm đà um cho thấm, nấu đến khi nước còn sền sệt.\r\n\r\n5.\r\n\r\nBày trí bún chay kiểu Huế: Múc sốt nấm ra tô. Cho bún đã trụng nóng vào tô, vài miếng thơm, đậu hũ, củ cải trắng. Rồi chan nước dùng lên tô bún, sau đó mới cho sốt nấm lên trên cùng, cho rau ngò gai, lá hành boa rô cắt nhỏ lên. Cách nấu bún chay thơm ngon nhưng lại đơn giản phải không nào? Cuối tuần rảnh rỗi, chị em hãy thử với cách nấu bún chay cực hấp dẫn này nhé.\r\n\r\n		f	2022-03-25 06:51:09.508491	1	11
